INSERT INTO `type` (`id`, `type`, `description`) VALUES
(1, 'Супы', 'Жидкое блюдо, в составе которого содержится не менее 50% жидкости. Жидкую часть супа называют основой, плотную - гарниром. Супы готовят на бульонах, отварах, молоке и молочных продуктах и квасе. Гарниром в супах выступают самые разнообразные продукты: овощи, грибы, крупы, бобовые и макаронные изделия, рыба, мясо и птица. Отличительная черта супа состоит в том, что его едят ложкой и не пользуются ножом для измельчения входящих в его состав продуктов.');

